import Card from "../UI/Card/Card";
import classes from "./MealList.module.css";
import Meal from "./MealsItem/MealItem.js";

const MealsList = function () {
  return (
    <Card className={classes.meals}>
      <Meal 
      mealName = 'sushi'
      mealD/>
      <Meal />
      <Meal />
      <Meal />
      <Meal />
      <Meal />
    </Card>
  );
};

export default MealsList;
